import React from 'react';
import { Container, Image, Menu } from 'semantic-ui-react';

export default () => (
  <Menu>
    <Container>
      <Menu.Item as="a" header>
      CONGRATS
      </Menu.Item>

      <Menu.Menu position="center">
      CONGRATS
      </Menu.Menu>
    </Container>
  </Menu>
);
